import React from 'react'
import '../App.css'

const Notification = ({message}) => {
    if (message === null){
        return null
    }
    return (
        <div className='error'>
            {message}
        </div>
    )
}

const errorMsg = ( {message} ) => {
    if (message === null){
        return null
    }
    return (
        <div className='error'>
            {message}
        </div>
    )
}


export default {
    Notification,
    errorMsg
}
